import React from 'react';

import {
   Paper, Card,
   CardMedia, CardContent, Grid,
   CardActions, Button, Typography
} from '@mui/material';

export default function Webcams(props) {
   return (
      props.webcams.map(cam => {
         return (
            <>
               <Typography>Web Cam Footage</Typography>
               <Grid item xs={12} sm={6} md={4} style={{ display: 'flex' }}>
                  <Card sx={{
                     maxWidth: 400,
                     margin: '0.8rem',
                  }}>
                     <CardMedia component='img'
                        image={cam.image}
                        alt='resort traffic webcam'>
                     </CardMedia>
                     <CardContent>
                        {cam.name}
                     </CardContent>
                     <CardActions>
                        <Button size='small'>View Time Lapse on Windy</Button>
                     </CardActions>
                  </Card>
               </Grid>
            </>
         )
      })
   );
}
